namespace unicode;

/**
 * Unicode Normalization Forms implementation.
 *
 * @link http://www.unicode.org/reports/tr15/
 */
final class Normalize
{

  // {{{ constants

  /**
   * Hangul character boundaries and properties.
   */
  const SBase = 0xAC00;
  const SFinal = 0xD7A3;  // SBase -1 + SCount
  const SCount = 11172;   // LCount * NCount
  const NCount = 588;     // VCount * TCount
  const LBase = 0x1100;
  const LFinal = 0x1112;
  const LCount = 19;
  const VBase = 0x1161;
  const VFinal = 0x1175;
  const VCount = 21;
  const TBase = 0x11A7;
  const TFinal = 0x11C2;
  const TCount = 28;

  // }}}
  // {{{ constructor

  /**
   * Constructor.
   */
  private function __construct()
  {
  }

  // }}}
  // {{{ getmap()

  /**
   * Returns a mapping table.
   *
   * @param string $name A table name.
   * @return array
   */
  private static function getmap($name)
  {
    static $table;
    if (!isset($table))
    {
      $fp = \fopen(__FILE__, 'r');
      \fseek($fp, __COMPILER_HALT_OFFSET__);
      $table = \unserialize(\stream_get_contents($fp));
      \fclose($fp);
    }
    return $table[$name];
  }

  // }}}
  // {{{ compose()

  /**
   * Composes the specified string.
   *
   * @param string $string A string.
   * @return string
   */
  public static function compose($string)
  {
    $compos = self::getmap('compos');
    $combin = self::getmap('combin');
    $result = '';
    $n = 0;
    $cc = '';
    $combining = '';
    $token = \preg_split('//u', $string, -1, \PREG_SPLIT_NO_EMPTY);
    foreach ($token as $char)
    {
      $pair = $cc . $char;
      if (isset($combin[$char]))
      {
        $class = $combin[$char];
        if (!empty($cc) && ($n < $class) && isset($compos[$pair]))
        {
          $cc = $compos[$pair];
          $class = 0;
        }
        else
        {
          $combining .= $char;
        }
        $n = $class;
        continue;
      }
      if ($n === 0)
      {
        if (isset($compos[$pair]))
        {
          $cc = $compos[$pair];
          continue;
        }
        if (!empty($cc))
        {
          $ucs = Encoding::UTF8toUCS4($cc . $char);
          $uv1 = $ucs[0];
          $uv2 = $ucs[1];
          if (($uv1 >= self::LBase) && ($uv1 <= self::LFinal) &&
              ($uv2 >= self::VBase) && ($uv2 <= self::VFinal))
          {
            $lindex = ($uv1 - self::LBase);
            $vindex = ($uv2 - self::VBase);
            $cc = Encoding::UCS4toUTF8(array(self::SBase +
              ((($lindex * self::VCount) + $vindex) * self::TCount)));
            continue;
          }
          elseif (($uv1 >= self::SBase) && ($uv1 <= self::SFinal) &&
                  ($uv2 >= self::TBase) && ($uv2 <= self::TFinal) &&
                  ((($uv1 - self::SBase) % self::TCount) === 0))
          {
            $cc = Encoding::UCS4toUTF8(array(($uv1 + $uv2) - self::TBase));
            continue;
          }
        }
      }
      $result .= $cc . $combining;
      $cc = $char;
      $combining = '';
      $n = 0;
    }
    $result .= $cc . $combining;
    return $result;
  }

  // }}}
  // {{{ decompose()

  /**
   * Decomposes the specified string.
   *
   * @param string $string A string.
   * @param boolean $compat A compatibility flag.
   * @return string
   */
  public static function decompose($string, $compat = false)
  {
    $table = self::getmap($compat ? 'compat' : 'canon');
    $result = '';
    $token = \preg_split('//u', $string, -1, \PREG_SPLIT_NO_EMPTY);
    foreach ($token as $char)
    {
      if (isset($table[$char]))
      {
        $char = $table[$char];
      }
      else
      {
        $ucs = Encoding::UTF8toUCS4($char);
        $cp = $ucs[0];
        if (($cp >= self::SBase) && ($cp <= self::SFinal))
        {
          $sindex = ($cp - self::SBase);
          $lindex = (int) ($sindex / self::NCount);
          $vindex = (int) (($sindex % self::NCount) / self::TCount);
          $tindex = ($sindex % self::TCount);
          $ucs = array((self::LBase + $lindex), (self::VBase + $vindex));
          if ($tindex > 0)
          {
            $ucs[] = (self::TBase + $tindex);
          }
          $char = Encoding::UCS4toUTF8($ucs);
        }
      }
      $result .= $char;
    }
    return $result;
  }

  // }}}
  // {{{ reorder()

  /**
   * Reorders the combining characters.
   *
   * @param string $string A string.
   * @return string
   */
  public static function reorder($string)
  {
    $table = self::getmap('combin');
    $result = '';
    $combin = array();
    $n = 0;
    $token = \preg_split('//u', $string, -1, \PREG_SPLIT_NO_EMPTY);
    foreach ($token as $char)
    {
      if (isset($table[$char]))
      {
        $n = $table[$char];
        if (!isset($combin[$n]))
        {
          $combin[$n] = '';
        }
        $combin[$n] .= $char;
        continue;
      }
      if ($n > 0)
      {
        \ksort($combin);
        $result .= \implode('', $combin);
        $combin = array();
        $n = 0;
      }
      $result .= $char;
    }
    if ($n > 0)
    {
      \ksort($combin);
      $result .= \implode('', $combin);
    }
    return $result;
  }

  // }}}
  // {{{ NFC()

  /**
   * Normalization Form Canonical Composition.
   *
   * @param string $string A string.
   * @return string
   */
  public static function NFC($string)
  {
    $string = self::decompose($string);
    $string = self::reorder($string);
    $string = self::compose($string);
    return $string;
  }

  // }}}
  // {{{ NFKC()

  /**
   * Normalization Form Compatibility Composition.
   *
   * @param string $string A string.
   * @return string
   */
  public static function NFKC($string)
  {
    $string = self::decompose($string, true);
    $string = self::reorder($string);
    $string = self::compose($string);
    return $string;
  }

  // }}}
  // {{{ NFD()

  /**
   * Normalization Form Canonical Decomposition.
   *
   * @param string $string A string.
   * @return string
   */
  public static function NFD($string)
  {
    $string = self::decompose($string);
    $string = self::reorder($string);
    return $string;
  }

  // }}}
  // {{{ NFKD()

  /**
   * Normalization Form Compatibility Decomposition.
   *
   * @param string $string A string.
   * @return string
   */
  public static function NFKD($string)
  {
    $string = self::decompose($string, true);
    $string = self::reorder($string);
    return $string;
  }

  // }}}

}

